    return (
        <main className='Solution'>
            <h2 style={{
                textAlign: 'center'
            }}>
                Introducing Convo,
                <br />
                <span style={{color:'var(--light-text-color)'}}>Your social sidekick.</span>
            </h2>
            <img style={{width: '50vw'}} src={mock2} alt="App Preview 2" />
        </main>
    );
}

export default Solution;
